import React , {useState} from "react";
import './css/infoStats.css'
import {Card,CardContent,Typography} from "@material-ui/core";

function InfoStats({title , count , active ,total , ...props}){

    const[name , setName] = useState("");

    if (active.casesType === "cases"){

        setName("infoStats_Cases");

    }

    return(




        <Card onClick = {props.onClick} className={`infoStats ${active && {name}}`}>

         <CardContent>

             <Typography className='infoStats_title' color='textSecondary'>{title}</Typography>

             <h4 className='infoStats_count'>{count}</h4>

             <Typography className='infoStats_total' color='textSecondary'>{total} Total</Typography>


         </CardContent>


        </Card>



    );

}

export default InfoStats;
